import React from 'react'; // Import the Component component from React

import ProjectHeader from './../projectPage/ProjectHeader.js'
import HeroImage from './../projectPage/HeroImage.js'
import SectionOne from './../projectPage/SectionOne.js'
import Image from './../projectPage/Image.js'
import Text from './../projectPage/Text.js'

import Divider from './../projectPage/Divider.js';


const data = {
  'heroImage':require('./../../content/projects/panaseer/hero-image.png'),
}

const a = {
  'image':require('./../../content/projects/panaseer/1.png')
}

const b = {
  'title':'IR Spectroscopy',
  'text':'The core technlogy behind Panaseer is Infrared spectroscopy which allows for the identification of organic compunds by projecting a range of infrared frequencies onto the compund and measuring which frequencies are returned, as different types of chemical bond absorb different frequencies. Taking the types and numbers of bonds into account, specific com- pounds can be identified by comparison to a database.',
  'image':require('./../../content/projects/panaseer/23.png')
}



function Panaseer(props) {
    return(
      <div>
        <ProjectHeader
         projectKey='panaseer'
        />
        <HeroImage
         heroImage={data.heroImage}
        />
        <Divider/>
        <Text
         text='**Key Features and Technologies**'
         col="col-12"
         height="10px"
         align="left"
         font="100px"
         type="title-wrapper"
        />
        <Image
         image={a.image}
         col="col-12"
         height="600px"
         padding="50px 300px"
        />
        <SectionOne
         title={b.title}
         text={b.text}
         image={b.title}
        />
      </div>
    )
}

export default Panaseer;
